'use strict';

const BaseClientFactory = require('./baseClientFactory');

class BunnyBusClientFactory extends BaseClientFactory {
    constructor() {
        super();
    }

    build(name) {
        const BunnyBus = require('@tenna-llc/bunnybus');

        return new BunnyBus(super.get(name));
    }
}

module.exports = BunnyBusClientFactory;
